/*
** EPITECH PROJECT, 2020
** B-DEV-500-PAR-5-1-cardgames-lucas.guyader
** File description:
** JsonFile.js
*/

import React, { Component } from "react";
import About from "../about.json";

class JsonFile extends Component {
    render() {
        return (
            <div>
                {About.map((postDetail, index) => {
                    return <div>
                        <p>{postDetail["client "]}</p>
                        <p>{postDetail["server "]}</p>
                        </div>
                })}
            </div>
        );
    }
}

export default JsonFile;
